import React, { useState } from 'react'
import exampleresponse from '../../src/data/exampleresponse.json'

export default function Card({item }) {
  const[like,setLike]=useState(item.rating)
  const[dislike,setDislike]=useState(item.rating)

  const handleDelete=()=>{
   exampleresponse.filter((element,index)=>{
        item.id != index
   })
  }

  return (
    <div>
       <div className="w3-card-4 w3-dark-grey" style={{width:"50%"}}>

<div className="w3-container w3-center">
  <h3>{item.title}</h3>
  <div className="w3-section">
    <button className="w3-button w3-green" onClick={()=>setLike(like+1)}>Like: {like}</button>
    <button className="w3-button w3-red" onClick={()=>setDislike(dislike+1)}>Dislike: {dislike}
    </button>
  </div>

  <iframe id="inlineFrameExample"
    title="Inline Frame Example"
    height="200"
    style={{border: '0px',width: '100%'}}
    src='https://www.youtube.com/watch?v=dQw4w9WgXcQ'>
</iframe>
  <h5>{item.rating}</h5>

  <div className="w3-section">
    <button className="w3-button w3-green" onClick={handleDelete}>Delete</button>

  </div>
</div>

</div>
    </div>
  )
}
